(11, -1, '', 'Exchange', 146, '1', '1', 1, '0', 17, 'default_3x3', 'catalog_bank_headline1', 'catalog_bank_teaser', ' ', 'Habbo Exchange is where you can convert your Credits into a tradable currency. You can then use this currency to trade for Furni or just show off your riches in your room.', ' ', '', ' ', '0', '', ''),
